import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  Box,
  TextField,
  MenuItem,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  Switch,
  FormControlLabel,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  IconButton,
} from "@mui/material";
import { styled } from "@mui/material/styles";
import { Formik, Form, Field } from "formik";
import CloseIcon from "@mui/icons-material/Close";
import DeleteIcon from "@mui/icons-material/Delete";
import EditIcon from "@mui/icons-material/Edit";
import InteviewPortal from "./InteviewPortal";

const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  "& .MuiDialogContent-root": { padding: theme.spacing(2) },
  "& .MuiDialogActions-root": { padding: theme.spacing(1) },
}));

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${TableCell.head}`]: { backgroundColor: "#1976d2", color: theme.palette.common.white },
  [`&.${TableCell.body}`]: { fontSize: 14 },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  "&:nth-of-type(odd)": { backgroundColor: theme.palette.action.hover },
}));

const Categary = () => {
  const [open, setOpen] = useState(false);
  const [list, setList] = useState([]);
  const [editId, setEditId] = useState(null);
  const [searchCat, setSearchCat] = useState("");
  const [ini, setIni] = useState({ categoryName: "" });
  const token = "your_auth_token_here"; // Replace with actual token

  useEffect(() => {
    dataView();
  }, []);

  const handleClickOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const dataView = () => {
    axios.get("https://interviewback-ucb4.onrender.com/category/", {
      headers: { Authorization: token },
    })
    .then((res) => setList(res.data.data))
    .catch((err) => console.log(err));
  };

  const handleSubmit = (values, { resetForm }) => {
    const url = editId ? `https://interviewback-ucb4.onrender.com/category/${editId}` : "https://interviewback-ucb4.onrender.com/category/create";
    const method = editId ? axios.patch : axios.post;

    method(url, values, { headers: { Authorization: token } })
      .then(() => {
        dataView();
        setEditId(null);
        handleClose();
      })
      .catch((err) => console.log(err));

    resetForm();
    setIni({ categoryName: "" });
  };

  const deleteData = (id) => {
    axios.delete(`https://interviewback-ucb4.onrender.com/category/${id}`, { headers: { Authorization: token } })
      .then(() => dataView())
      .catch((err) => console.log(err));
  };

  const editData = (id, row) => {
    setIni(row);
    setEditId(id);
    handleClickOpen();
  };

  const searchCategory = (e) => {
    const value = e.target.value;
    setSearchCat(value);
    axios.get(`https://interviewback-ucb4.onrender.com/category/?search=${value}`, { headers: { Authorization: token } })
      .then((res) => setList(res.data.data))
      .catch((err) => console.log("Search error:", err));
  };

  const handleSwitch = (e, id) => {
    axios.patch(`https://interviewback-ucb4.onrender.com/category/${id}`, { status: e.target.checked ? "on" : "off" }, { headers: { Authorization: token } })
      .then(() => dataView())
      .catch((err) => console.log(err));
  };

  return (
    <InteviewPortal>
      <Box sx={{ display: "flex", flexWrap: "wrap", width: "100%" }}>
        <TextField label="Search Category" value={searchCat} sx={{ flex: 1 }} onChange={searchCategory} />
        <Button sx={{ ml: 2, backgroundColor: "#1976d2", color: "white" }} onClick={handleClickOpen}>
          ADD CATEGORY
        </Button>
      </Box>

      <BootstrapDialog open={open} onClose={handleClose}>
        <DialogTitle>Add Category</DialogTitle>
        <IconButton onClick={handleClose} sx={{ position: "absolute", right: 8, top: 8 }}>
          <CloseIcon />
        </IconButton>
        <Formik enableReinitialize initialValues={ini} onSubmit={handleSubmit}>
          <Form>
            <DialogContent dividers>
              <Field as={TextField} name="categoryName" label="Category" fullWidth />
            </DialogContent>
            <DialogActions>
              <Button type="submit" sx={{ backgroundColor: "#1976d2", color: "white" }}>
                Submit
              </Button>
            </DialogActions>
          </Form>
        </Formik>
      </BootstrapDialog>

      <TableContainer component={Paper} sx={{ mt: 2 }}>
        <Table>
          <TableHead>
            <TableRow>
              <StyledTableCell>No.</StyledTableCell>
              <StyledTableCell align="center">Category Name</StyledTableCell>
              <StyledTableCell align="center">Status</StyledTableCell>
              <StyledTableCell align="center">Delete</StyledTableCell>
              <StyledTableCell align="center">Update</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {list.map((row, i) => (
              <StyledTableRow key={row._id}>
                <StyledTableCell>{i + 1}</StyledTableCell>
                <StyledTableCell align="center">{row.categoryName}</StyledTableCell>
                <StyledTableCell align="center">
                  <FormControlLabel
                    control={<Switch checked={row.status === "on"} onChange={(e) => handleSwitch(e, row._id)} />}
                  />
                </StyledTableCell>
                <StyledTableCell align="center">
                  <IconButton onClick={() => deleteData(row._id)}><DeleteIcon /></IconButton>
                </StyledTableCell>
                <StyledTableCell align="center">
                  <IconButton onClick={() => editData(row._id, row)}><EditIcon /></IconButton>
                </StyledTableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </InteviewPortal>
  );
};

export default Categary;
